question:
Rozważmy następujący algorytm Alg:

```
int Alg(int n) {
  for (int i_1=0; i_1<; i_1++) do {
    for (int i_2=0; i_2<; i_2++) do {
      Alg_0(n);
    }
  }

  Alg_1(n);

  for (int i_1=0; i_1<; i_1++) do {
    Alg_0(n);
    Alg_2(n);
  }

  Alg_2(n);
}
```

gdzie:
* $T(Alg_0,n)=\Theta(n^{e-1})$
* $T(Alg_1,n)=\Theta(n^2), W(Alg_1,n)=\Omega(\log^7 n)$
* $T(Alg_2,n)=\Omega{n}$

Które z poniższych zdań jest prawdziwe?
